export const ComputerPartsContext = createContext();

export const ComputerPartsContextProvider = props => {
    const[computerPart, setComputerParts] = useState([])

    return(
        <ComputerPartsContext.Provider value={{computerParts, setComputerParts}}>
            {props.children}
        </ComputerPartsContext.Provider>
    )
}
